import React from "react";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";

const App = () => {
  return (
    <>
      <div className="container">
        <h1 className="text-center"> Welcome </h1>
        <br />
        <button > Welcome to fut </button>
      </div>
    </>
  );
};

export default App;
